import React from 'react';
import './App.css';

const App =() => {
  return (
    <div className="App">
      <header>
        <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Instagram_logo_2016.svg/768px-Instagram_logo_2016.svg.png"></img>
      </header>
    </div>
  );
}

export default App;
